import React from 'react';

const MenuItem = ({ title, imageUrl }) => {
	return (
		<div
			style={{
				backgroundImage: `url(${imageUrl})`
			}}
			className='menu-item '
		>
			<div className='content'>
				<h1 className='title'>{title}</h1>
				<span className='subtitle'>shop</span>
			</div>
		</div>
	);
};

export default MenuItem;
